import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-principal',
  templateUrl: './principal.component.html',
  styleUrls: ['./principal.component.css']
})
export class PrincipalComponent implements OnInit {
  cintasDisponibles: any[] = [];
  socioSeleccionado: string = '';
  sociosDisponibles: any[] = [];
  cintaSeleccionada: string = '';

  constructor(private http: HttpClient) {}

  ngOnInit() {
    this.obtenerCintasDisponibles();
    this.obtenerSociosDisponibles();
  }

  obtenerCintasDisponibles() {
    this.http.get<any>('http://localhost:5000/api/cinta').subscribe(
      response => {
        this.cintasDisponibles = response.cintasDisponibles;
      },
      error => {
        console.error(error);
      }
    );
  }

  obtenerSociosDisponibles() {
    this.http.get<any>('http://localhost:5000/api/socio').subscribe(
      response => {
        this.sociosDisponibles = response;
      },
      error => {
        console.error(error);
      }
    );
  }

  enviarFormulario() {
    const formData = {
      cinta: this.cintaSeleccionada,
      socio: this.socioSeleccionado,
      fecha: (document.getElementById('fecha') as HTMLInputElement).value
    };

    this.http.post('http://localhost:5000/api/ficha/prestamo', formData).subscribe(
      response => {
        console.log('Formulario enviado con éxito:', response);
        // Realiza cualquier acción adicional después de enviar el formulario
      },
      error => {
        console.error('Error al enviar el formulario:', error);
      }
    );
  }
}
<!DOCTYPE html>
<html>
<head>
  <title>Prestamo</title>
  <script src="https://code.jquery.com/jquery-3.6.0.min.js"></script>
</head>
<body>
  <div class="container">
    <h1>Prestamo</h1>
    <form id="prestamo-form" (ngSubmit)="enviarFormulario()">
      <div class="form-group">
        <label for="movie-name">Numero de la cinta:</label>
        <select id="cinta" [(ngModel)]="cintaSeleccionada">
          <option *ngFor="let cinta of cintasDisponibles" [value]="cinta._id">{{ cinta.nombrePelicula }} - {{ cinta._id.substring(0, 5) }}</option>
        </select>
      </div>
      <div class="form-group">
        <label for="director">Nombre del socio:</label>
        <select id="socio" [(ngModel)]="socioSeleccionado">
          <option *ngFor="let socio of sociosDisponibles" [value]="socio._id">{{ socio.nombre }}</option>
        </select>
      </div>
      <div class="form-group">
        <label for="actor">Fecha en que se lleva la cinta:</label>
        <input type="date" id="fecha" name="fecha" placeholder="Ingrese el nombre del actor" value="por defecto el plazo es de una semana">
      </div>
      
      <button type="submit">Enviar</button>
    </form>
  </div>
</body>
</html>
